import React from "react";
import { Link } from "react-router-dom";

export default function Contact() {
  return (
    <div style={{background: '#99d8ff'}} className="pb-2 pt-2">
      <div style={{ fontFamily: "Josefin Sans", width: '50vw' }} className="pt-5 bg-white mx-auto">
        <h1>Contact us!</h1>
        <h4
          as={{ Link }}
          style={{ color: "black" }}
          className="fa-solid fa-envelope mb-5"
          onClick={() =>
            (window.location = "mailto:diamonddoesmusic@gmail.com")
          }
        >
          {""} diamonddoesmusic@gmail.com
        </h4>
      </div>
    </div>
  );
}
